import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";
import Fpoa from "./component/hero/Fpoa";
import Card from './component/hero/Card';




import card1 from './asstes/images/iplslider2.jpg'




function App() {

 const CardData = [
    {
      id: 1,
      title: 'Beautiful Landscape',
      description: 'A beautiful view of mountains during sunset.',
      image: card1
    },
    {
      id: 2,
      title: 'City Skyline',
      description: 'Night view of a modern city skyline.',
      image: 'https://images.unsplash.com/photo-1494526585095-c41746248156?auto=format&fit=crop&w=400&q=80'
    },
    {
      id: 3,
      title: 'Forest Path',
      description: 'Pathway through a lush green forest.',
      image: 'https://images.unsplash.com/photo-1500534623283-312aade485b7?auto=format&fit=crop&w=400&q=80'
    },
     {
      id: 3,
      title: 'Forest Path',
      description: 'Pathway through a lush green forest.',
      image: 'https://images.unsplash.com/photo-1500534623283-312aade485b7?auto=format&fit=crop&w=400&q=80'
    },
     {
      id: 3,
      title: 'Forest Path',
      description: 'Pathway through a lush green forest.',
      image: 'https://images.unsplash.com/photo-1500534623283-312aade485b7?auto=format&fit=crop&w=400&q=80'
    },
     {
      id: 3,
      title: 'Forest Path',
      description: 'Pathway through a lush green forest.',
      image: 'https://images.unsplash.com/photo-1500534623283-312aade485b7?auto=format&fit=crop&w=400&q=80'
    },
  ];


  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center p-6">
      <ShortsCarousel />
    </div>
    <Fpoa/>
    {/* <Card/> */}
    <div style={{ padding: '30px', backgroundColor: '#f0f2f5', minHeight: '100vh' }}>
      <Card
        image="https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=600&q=80"
        title="Starlit Sky"
        description="A peaceful night under a sky full of stars."
      />
    </div>
    </div>
  );
}

export default App;
